# works but time exceed limit
# @param {String} s
# @return {Integer}
def length_of_longest_substring(s)
  if s.length == 0
    return 0
  elsif s.length == 1
    return 1
  else
    res = 0
    n = 0
    temp = []
    while n <= s.length-1
      if !temp.include?(s[n])
        temp << s[n]
      else
        if res <= temp.length
          res = temp.length
        end
        n = n - (temp.length-1 - temp.index(s[n]))
        temp = []
      end
      if res <= temp.length
        res = temp.length
      end
      n += 1
    end
    return res
  end
end
